import React from 'react';
import '../css/Bootstrap.css';

const Header = () => {
  return(
    <div className="ui secondary pointing menu">
      <div className="right menu">
        <i class="glyphicon glyphicon-home"></i>
      </div>
    </div>
  );
}

export default Header;
